import React from 'react';
import './App.css';
// import ReactPlayer from 'react-player';
import './css/style.css';
import VideoDisplay from './js/component/videoDisplay';


function App() {
  const videos = [
    'https://drive.google.com/drive/u/0/folders/1bsgNaeM5r1ZlfcEcYl0iDRG1vMBXf7mD',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=DLX62G4lc44',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=35lXWvCuM8o',
    'https://www.youtube.com/watch?v=CVpUuw9XSjY'
  ];

  const listItems = videos.map((video, index) =>
    <div key={index}>
      <VideoDisplay url={video}/>
    </div>
  );

  return (
    <div className="grid-container">{listItems}</div>
  );
}


export default App;
